import Foundation

@available(iOS 11.3, *)
@objc(EngineViewManager)
final class EngineViewManager : RCTViewManager {
    override func view() -> UIView! {
        let view = EngineView(frame: .zero)
        return view
    }

    override static func requiresMainQueueSetup() -> Bool {
        return true
    }

}
